import React, { Component } from 'react';

class Machine extends Component{
    render(){
        const {s1,s2,s3} = this.props;
        return(
            <div>
                <h3>{s1} {s2} {s3}</h3>
                {this.props}
            </div>
        );
    }
}

export default Machine;
